import React from 'react'

const Working = () => {
  return (
    <>
    <h2 className='text-black text-center'>How the app works</h2>
    <div className='container-fluid'>
    <div className="row">
      <div className="col-md-6">
        <img src="images/login.png size img-fluid" alt="Login" />
      </div>
    </div>
    </div>
    </>
    
  )
}

export default Working;
